"use strict";function __getuser_getLists(){var e=getParameterByName("id");$.ajax({url:Global.API_URL+"/accesscontrol/appuser/get?id="+e,type:"GET",async:!0,dataType:"json",cache:!0,beforeSend:function(e){e.setRequestHeader("Authorization","Bearer "+localStorage.getItem("Token"))},error:function(e,t,a){},complete:function(e){var t=checkNull(e.responseJSON.Email),a=checkNull(e.responseJSON.FullName),r=checkNull(e.responseJSON.UserName),s=checkNull(e.responseJSON.PhoneNumber),c=md5(t);$("#Email").html(t),$("#FullName").html(a),$("#UserName").html(r),$("#PhoneNumber").html(s),$("#avataruser").attr("src","https://www.gravatar.com/avatar/"+c+"?s=250")}})}$(document).ready(function(){__getuser_getLists()});